// DeleteUniqueIndexCache 删除索引存在的缓存
func (m *MembershipRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.Membership) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, m.cache.Key(CacheMembershipByConditionPrefix))
	keys = append(keys, m.cache.Key(CacheMembershipUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[m.cache.Key(CacheMembershipByIDPrefix, item.ID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMembershipUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMembershipByTypePrefix, item.Type)] = struct{}{}
			KeyMap[m.cache.Key(CacheMembershipUnscopedByTypePrefix, item.Type)] = struct{}{}
			KeyMap[m.cache.Key(CacheMembershipBySortPrefix, item.Sort)] = struct{}{}
			KeyMap[m.cache.Key(CacheMembershipUnscopedBySortPrefix, item.Sort)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := m.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
